import FullPageIntroWithFixedNavbar from './Components/MainMenu'
import SignIn from './Components/SignIn';
import SignUp from './Components/SignUp';
import ChartsPage from './Components/Graf';
import './App.css'
import NavBar from './Components/NavBar';
import MemberDetails from './Components/UploadImage';
import { GetCountNotV } from './Redux/Vaccinations/VaccinationsThunk';

import { MDBDropdown, MDBDropdownMenu, MDBDropdownToggle, MDBDropdownItem, MDBDropdownLink } from 'mdb-react-ui-kit';
import ProfilePage from './Components/UserProfile';
import MyUsers from './Components/MyUsers';
import UI from './Components/UploadImage';
import { MDBCard, MDBCardFooter, MDBCardImage, MDBCol, MDBRow } from 'mdbreact';
import {
  MDBCardText,
  MDBCardBody,
  MDBCardTitle
} from 'mdb-react-ui-kit';

function App() {
  return (


    <div className="App">
      <header className="App-header">

        {/* <UI></UI> */}
        <FullPageIntroWithFixedNavbar></FullPageIntroWithFixedNavbar>
        {/* <ProfilePage></ProfilePage>  */}
        {/* <MyUsers></MyUsers> */}
        {/* <SignUp></SignUp>   */}
        {/* <NavBar></NavBar> */}
        {/* <MemberDetails></MemberDetails>  */}
        {/* <ChartsPage></ChartsPage>
<button onClick={()=>GetCountNotV()}>לקבלת כל המשתמשים שאינןם מחוסנים לחץ כאן</button> */}
        {/* <UploadImage></UploadImage> */}
      </header>
      <main>
      <MDBCard className='col-11 bg-light'>
      <MDBRow className='g-0'>
        {/* <MDBCol md='4' >
          <MDBCardImage  src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTzz7YCQtj392OgcQyct2WgjF5VNN2NZ0qDjQ&usqp=CAU' alt='...' fluid className='w-100 ' />
        </MDBCol> */}
          <MDBCardBody>
            <MDBCardTitle>WELCOME TO OUR COVID-19</MDBCardTitle>
            <MDBCardText>
            On 21 February, Israel confirmed the first case of COVID-19. A female Israeli citizen who had flown home from Japan after being quarantined on the Diamond Princess tested positive at Sheba Medical Center. On 23 February, a second former Diamond Princess passenger tested positive, and was admitted to a hospital for isolation.
            </MDBCardText>
            <MDBCardText>
            On 27 February, a man, who had returned from Italy on 23 February, tested positive and was admitted to Sheba Medical Center. On 28 February, his wife also tested positive. On 1 March, a female soldier tested positive for the virus. She had been working at the toy store managed by the same man diagnosed on 27 February. On 3 March, three more cases were confirmed. Two contracted the virus at the same toy store: a middle school student who worked at the store, and a school deputy principal who shopped there. Following this, 1,150 students entered a two-week quarantine. One other person, who had returned from a trip to Italy on 29 February, also tested positive for the virus
            </MDBCardText>
            <MDBCardText>
              <small className='text-muted'>Last updated 3 mins ago</small>
            </MDBCardText>
          </MDBCardBody>
          <MDBCardFooter>
            <MDBCardImage>

            </MDBCardImage>
          </MDBCardFooter>
      </MDBRow>
    </MDBCard>

      </main>
    </div>

  );
}

export default App;
